    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 - + + col0 IN ( - 42 + - ( col0 ) / + col0 );
  - name: tab1

outputs:
  - name: q1642.out
    data: |
      51	14	96
      85	5	59
      91	47	68
